import React, {Fragment} from "react";


function Advertencia(score) {
    if (score > 30){
      return (
        <Fragment>
        <input type="radio" className="radio" name="progress" value="twentyfive" id="twentyfive" defaultChecked></input>
         <label for="twentyfive"  className="label">65%</label>
         <p>Alto</p>

        <div className="progress">
            <div className="progress-bar"></div>
        </div>
        </Fragment>
      );
    } else {
      return(
        <Fragment>
        <input type="radio" className="radio" name="progress" value="twentyfive" id="twentyfive" checked></input>
         <label  className="label">15%</label>
         <p>Alto</p>
            <p>Bajo</p>
        <div className="progress">
            <div className="progress-bar"></div>
        </div>
        </Fragment>
      );
    }
}

const Alertbar = ({score}) => {
    return(
        Advertencia(score)
    );
};

export default Alertbar;
